import React from 'react';
import '../../utils/style/Buttons.css';

function Button2(){
	return (
		<div class="wrapper">
  			<a className='btn__link2' href="#conbtact">
				<span className='btn__span2'>Rejoignez-nous!</span>
			</a>
		</div>
	)
}

export default Button2
